    // Função de pesquisa
    function search() {
        // Obter o valor do campo de pesquisa
        var input = document.getElementById("searchInput").value.toLowerCase();
        var searchResults = document.getElementById("searchResults");
        searchResults.innerHTML = ""; // Limpar os resultados anteriores

        // Percorrer os conteúdos do script.js
        for (var i = 0; i < contents.length; i++) {
            var content = contents[i].toLowerCase();
            // Verificar se o conteúdo corresponde à pesquisa
            if (content.includes(input)) {
                // Criar um elemento de lista para o resultado
                var listItem = document.createElement("li");
                listItem.textContent = contents[i];
                // Adicionar o resultado à lista de resultados
                searchResults.appendChild(listItem);
            }
        }
    }


