function mudarCorTexto() {
    for (let i = 0; i < data.length; i++) {
        const elemento = data[i];
        const nome = elemento.name;
        const cor = elemento.color;

        // Obtém o elemento de texto pelo nome
        const textoElemento = document.getElementById(nome);
        if (textoElemento) {
            textoElemento.style.color = cor;
        }
    }
}

function displayResults(results) {
    const searchResults = document.getElementById("searchResults");
    searchResults.innerHTML = ""; // Limpa os resultados anteriores

    results.forEach(result => {
        const p = document.createElement("p");
        const strong = document.createElement("strong"); // Criar elemento para texto em negrito
        strong.textContent = result.name; // Definir o texto em negrito
        strong.style.color = result.color; // Define a cor do texto com base nos resultados
        p.appendChild(strong); // Adicionar texto em negrito ao parágrafo
        searchResults.appendChild(p);
    });
}


function search() {
    const input = document.getElementById("searchInput").value.toLowerCase();
    const results = data.filter(item => item.name.toLowerCase().includes(input));
    displayResults(results);
}
